import React, {FC} from "react";
import { IGoods } from "../types/types";
import MyCheckbox from "./UI/checkbox/MyCheckbox";

interface CheckboxListProps {
    value: any;
    filtredGoodsList: IGoods[];
    onClick?: any;
}

interface producersArrayType {
    id: number;
    value: string;
}

const CheckboxList:FC<CheckboxListProps> = ({value, filtredGoodsList, onClick}) => {
    let producersArray:producersArrayType [] = filtredGoodsList.map( good => good.producer);
    console.log(producersArray)



    const res = producersArray.reduce((acc, i) => {
        if (acc.hasOwnProperty(i)) {
          acc[i] += 1;
        } else {
          acc[i as keyof typeof acc] = 1;
        }
        return acc;
    },{})

      console.log(res)

    return (
        <div>
            {filtredGoodsList.map( good => 
            <MyCheckbox 
            key={good.id} 
            good={good}
                />
            )}
        </div>
    );
};

export default CheckboxList
